import React, { useState, useEffect } from 'react';
import './UserPage.css';
import Axios from 'axios';

function UserPage() {
  const [userData, setUserData] = useState({
    name: '',
    email: '',
    username: '',
    // Add other user properties as needed
  });

  useEffect(() => {
    // Fetch user information when the component mounts
    const fetchUserData = async () => {
      try {
        const response = await Axios.get('http://your-api-endpoint/user'); // Replace with your actual API endpoint
        const { name, email, username } = response.data; // Adjust this based on your API response structure
        setUserData({
          name,
          email,
          username,
          // Set other user properties as needed
        });
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };

    fetchUserData();
  }, []); // Empty dependency array ensures that the effect runs only once, similar to componentDidMount

  return (
    <div className="container">
      {/* ... (rest of your component) */}
      <div className="name">{userData.name}</div>
      <div className="email">{userData.email}</div>
      <div className="username">{userData.username}</div>
      {/* Add other elements to display additional user information */}
    </div>
  );
}

export default UserPage;
